import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  (App.js).ready(function() {
    ("button").click(function() {
        ("div").animate({left: '250px'});
    });
})

);
